import React from 'react';
import TableRow from './tablerow';


class Table extends React.Component {


    options = [
        { value: "0", label: 'None' }, 
        { value: "1", label: 'Normal' }, 
        { value: "2", label: 'Fire' }, 
        { value: "3", label: 'Water' }, 
        { value: "4", label: 'Electric' }, 
        { value: "5", label: 'Grass' }, 
        { value: "6", label: 'Ice' }, 
        { value: "7", label: 'Fighting' }, 
        { value: "8", label: 'Poison' }, 
        { value: "9", label: 'Ground' }, 
        { value: "10", label: 'Flying' }, 
        { value: "11", label: 'Psychic' }, 
        { value: "12", label: 'Bug' }, 
        { value: "13", label: 'Rock' }, 
        { value: "14", label: 'Ghost' }, 
        { value: "15", label: 'Dragon' }, 
        { value: "16", label: 'Dark' }, 
        { value: "17", label: 'Steel' }, 
        { value: "18", label: 'Fairy' }
    ]

    handleSubmit(event) {
        alert("Type1: " + this.state.type1 + "\nType2: " + this.state.type2)
        event.preventDefault();
    }

    render(){
        return (
            <table className="table table-dark table-hover mt-5">
                <thead>
                    <tr>
                    <th scope="col">Pokemon</th>
                    <th scope="col">Weakness</th>
                    <th scope="col">Resistance</th>
                    </tr>
                </thead>
                <tbody>
                    <TableRow options={this.options}/>
                    <TableRow />
                    <TableRow />
                    <TableRow />
                    <TableRow />
                    <TableRow />
                </tbody>
            </table>
        );
    }
};

export default Table;
